import React from 'react';
import { FieldError } from 'react-hook-form'; // Importe FieldError aqui

interface InputProps {
    placeholder: string;
    type: string;
    error?: string;
}

const InputModel: React.FC<InputProps> = ({ placeholder, type, error }) => {
    


    return (
        <div className="my-10">
            <input
                placeholder={placeholder}
                type={type}
                className="p-5 w-full bg-slate-100 rounded-xl placeholder:text-lg"
                
            />
            {/* {error && <div className="error">{error}</div>}  */}
        </div>
    );
};

export default InputModel;
